$('.table .item').click(function() {
	var element = $(this);

	// remove all class active except this
	element.siblings().removeClass('active');

	// Give class active
	element.toggleClass('active');

	if (element.hasClass('active') == true) {
		$('.detail-info .no-select').hide();
		$('.detail-info .select, .detail-info .attachment').show();
	} else {
		$('.detail-info .no-select').show();
		$('.detail-info .select, .detail-info .attachment').hide();
	}
});
$.validate({
	modules : 'date, security, file'
});
// Click Toggle
$.fn.clicktoggle = function(a, b) {
	return this.each(function() {
		var clicked = false;
		$(this).bind("click", function() {
			if (clicked) {
				clicked = false;
				return b.apply(this, arguments);
			}
			clicked = true;
			return a.apply(this, arguments);
		});
	});
};

// Get Url Parameter
var getUrlParameter = function getUrlParameter(sParam) {
	var sPageURL = decodeURIComponent(window.location.search.substring(1)),
		sURLVariables = sPageURL.split('&'),
		sParameterName,
		i;

	for (i = 0; i < sURLVariables.length; i++) {
		sParameterName = sURLVariables[i].split('=');

		if (sParameterName[0] === sParam) {
			return sParameterName[1] === undefined ? true : sParameterName[1];
		}
	}
};
function navShow() {
	$('.ka-menus').css('margin-left', 0);
	$('.ka-sidebar-detail').hide();
}

function navClose() {
	$('.ka-menus').css('margin-left', '-100%');
	$('.ka-sidebar-detail').show();
}

// function callback
$(".nav-toggle").clicktoggle(navShow, navClose);
$('.new-notif').click(function() {
	$(this).find('.fa-bell').removeClass('animated infinite');
	$(this).removeClass('new-notif');
});
function seePassword(e) {
	$(e).click(function() {
		var name = $(this).data('name');
		var element = $('input[name="' + name + '"]');
		var type = element.attr('type');
		if (type == 'text') {
			element.attr('type', 'password');
			$(this).html('<i class="fa fa-eye"></i>');
		} else {
			element.attr('type', 'text');
			$(this).html('<i class="fa fa-eye-slash"></i>');
		}
	});
}

seePassword('.see-password');

// NiceScroll
$(document).ready(function() {
	if($(window).width() > 992) {
		$('.ka-menus, .ka-main, .detail-info .select').niceScroll({
			cursorcolor: "rgba(0,0,0,.3)"
		});
	}
});


// Page Loader
$(window).load(function(){
	$(".page-loader").fadeOut();
});


// Image Preview
function readURL(input) {
	if (input.files && input.files[0]) {
		var reader = new FileReader();

		reader.onload = function (e) {
			$('#img-preview').html('<img src="'+ e.target.result +'" width="100%">');
		}

		reader.readAsDataURL(input.files[0]);
	}
}


// Checkbox Custom
function checkboxCustom (e) {
	$(e).parent().toggleClass('actived');
}


// Radio Custom
function radioCustom (e) {
	$('.radio-custom-item').removeClass('actived');
	$(e).parent().addClass('actived');
}


// Bootstrap
$(function () {
	$('[data-toggle="tooltip"]').tooltip();
});


// Favorite
$('#favorite').click(function() {
	$(this).find('i').toggleClass('fa-star fa-star-o');
});


// Auto submit after selected file
$('#inputFileSubmit').change(function() {
	$(this).closest('form').submit();
});


$('a').click(function() {
	$(this).attr('href').replace(/\#*/g, "");
});